      requests: this.state.request
  }
};

  render() {
    return (
      <div>
        {this.state.requests && this.state.requests.map(request => {
         return (           
         <div className="requestInfo">
         <form>
         <h4>Task ID:{request.id}</h4>
         <h4>Requester ID:{request.user_id}</h4>
         <h1>{request.title}</h1>
         <FulfilledButton/>
         </form>
         </div>)
        })
        }
      </div>
    )
  }
}



